import React from 'react';
import './Header.css'
function Header() {
  return (
    <div className='header'>
     
       <img className = "header_logo" 
       src = "https://lh3.googleusercontent.com/proxy/rRDU_vXWFR4OxXxczaJlzDXCTNaPTx-PFigl5RoulOAuD-vbjCzhbbiQ1u4Mfz2ynBn9K2s1jtVahBqVzqDYZi0BM7eeFELyV8mYUT0i_LI" />
    <div className = "header_search">
    <input className = "header_searchInput" type = "text" />

    </div>
    </div>
  );
}

export default Header;
